import { Link } from "react-router-dom";

const EVENTS = [
    { id: "e1", title: "Some title"},
    { id: "e2", title: "Another title"},
];

const Events = () => {
    return <>
        <h1>Events</h1>
        <ul>
            {
                EVENTS.map( (event) => 
                    <li key={event.id}>
                        <Link to={event.id}>{event.title}</Link>
                    </li>
                )
            }
        </ul>
    </>
};

export default Events;
